import React from 'react';
import { motion } from 'framer-motion';
import { useParams, Navigate, useNavigate } from 'react-router-dom';
import VideoBackground from './VideoBackground';

const ProfilePage = () => {
  const { profileType } = useParams();
  const navigate = useNavigate();

  const profileInfo = {
    Recruiter: {
      description: "Hi, I'm [Your Name]! I'm a passionate software developer with expertise in full-stack development. I specialize in building scalable web applications using modern technologies like React, Node.js, and cloud services. I'm currently seeking opportunities to contribute to innovative projects and grow as a developer.",
      projects: [
        {
          title: "Netflix Portfolio Clone",
          description: "A responsive Netflix-inspired portfolio showcasing my projects and skills",
          technologies: ["React", "Tailwind CSS", "Framer Motion"],
          image: "/project1.jpg"
        },
        // Add more projects here
      ]
    },
    Viewer: {
      description: "Welcome to my portfolio! I'm [Your Name], a creative developer who loves building beautiful and functional web applications. I believe in clean code, user-centered design, and continuous learning.",
      projects: [
        {
          title: "Interactive Dashboard",
          description: "A real-time data visualization dashboard for analytics",
          technologies: ["React", "D3.js", "Node.js"],
          image: "/project2.jpg"
        },
        // Add more projects here
      ]
    },
    Adventurer: {
      description: "Hey there! I'm [Your Name], an adventurous developer who loves exploring new technologies and pushing the boundaries of what's possible on the web. I'm always excited to take on new challenges and learn from every project.",
      projects: [
        {
          title: "AI-Powered Chat Application",
          description: "A real-time chat app with AI integration for smart responses",
          technologies: ["React", "OpenAI API", "WebSocket"],
          image: "/project3.jpg"
        },
        // Add more projects here
      ]
    }
  };

  // If the profile type is not valid, redirect to home
  if (!profileInfo[profileType]) {
    return <Navigate to="/" replace />;
  }

  const currentProfile = profileInfo[profileType];

  return (
    <motion.div 
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      className="min-h-screen bg-[#000000] text-white relative"
    >
      {/* Netflix-style gradient overlay */}
      <div className="absolute inset-0 bg-gradient-to-b from-[#000000] via-[#000000]/80 to-[#000000] z-10" />

      {/* Hero Section with Video - Only for Recruiter */}
      {profileType === 'Recruiter' && (
        <div className="relative h-[80vh]">
          {/* Video Background */}
          <VideoBackground 
            videoSrc="/header-video.mp4" 
            className="z-0"
          />

          {/* Navigation Bar */}
          <div className="absolute top-0 left-0 right-0 z-30 bg-[#000000]/90 backdrop-blur-sm border-b border-[#333333]">
            <div className="max-w-7xl mx-auto px-8 py-4">
              <div className="flex items-center space-x-8">
                {/* Logo */}
                <img 
                  src="/landing_page.png" 
                  alt="Portfolio Logo" 
                  className="h-16 cursor-pointer hover:opacity-80 transition-opacity"
                  onClick={() => navigate('/')}
                />

                {/* Navigation Links */}
                <div className="flex items-center space-x-6">
                  <span 
                    className="text-white cursor-pointer hover:text-[#E50914] transition-colors"
                    onClick={() => navigate('/profiles')}
                  >
                    Home
                  </span>
                  <span className="text-white cursor-pointer hover:text-[#E50914] transition-colors">
                    Professional
                  </span>
                  <span className="text-white cursor-pointer hover:text-[#E50914] transition-colors">
                    Skills
                  </span>
                  <span className="text-white cursor-pointer hover:text-[#E50914] transition-colors">
                    Projects
                  </span>
                  <span className="text-white cursor-pointer hover:text-[#E50914] transition-colors">
                    Contact Me
                  </span>
                </div>
              </div>
            </div>
          </div>

          {/* Hero Content at Bottom of Video */}
          <div className="absolute bottom-0 left-0 right-0 z-20 p-8">
            <div className="max-w-7xl mx-auto">
              <motion.h1 
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ delay: 0.5 }}
                className="text-6xl font-bold text-white mb-4"
              >
                Harsh Govindji
              </motion.h1>
              <motion.p 
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ delay: 0.7 }}
                className="text-xl text-[#B3B3B3] max-w-2xl leading-relaxed"
              >
                Passionate software developer with expertise in full-stack development, specializing in React, Node.js, and modern web technologies. I create scalable applications that solve real-world problems and deliver exceptional user experiences.
              </motion.p>
            </div>
          </div>
        </div>
      )}

      {/* Profile Description Section - Only for non-Recruiter profiles */}
      {profileType !== 'Recruiter' && (
        <motion.div 
          initial={{ y: 20 }}
          animate={{ y: 0 }}
          className="max-w-4xl mx-auto mb-12 relative z-20 p-8"
        >
          <h1 className="text-5xl font-bold mb-6 text-[#E50914]">{profileType}</h1>
          <p className="text-xl text-[#B3B3B3] leading-relaxed">
            {currentProfile.description}
          </p>
        </motion.div>
      )}

      {/* Projects Section */}
      <div className="max-w-7xl mx-auto relative z-20 px-8 pb-8">
        <h2 className="text-3xl font-bold mb-8 text-white">Featured Projects</h2>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {currentProfile.projects.map((project, index) => (
            <motion.div
              key={index}
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ delay: index * 0.1 }}
              className="bg-[#141414] rounded-lg overflow-hidden hover:scale-105 transform transition duration-300 border border-[#333333] hover:border-[#E50914]"
            >
              <div className="aspect-video bg-[#1F1F1F]">
                {/* Add project image here */}
                <div className="w-full h-full flex items-center justify-center text-[#B3B3B3]">
                  Project Image
                </div>
              </div>
              <div className="p-6">
                <h3 className="text-xl font-bold mb-2 text-white">{project.title}</h3>
                <p className="text-[#B3B3B3] mb-4">{project.description}</p>
                <div className="flex flex-wrap gap-2">
                  {project.technologies.map((tech, techIndex) => (
                    <span
                      key={techIndex}
                      className="px-3 py-1 bg-[#1F1F1F] rounded-full text-sm text-[#B3B3B3]"
                    >
                      {tech}
                    </span>
                  ))}
                </div>
              </div>
            </motion.div>
          ))}
        </div>
      </div>
    </motion.div>
  );
};

export default ProfilePage;
